import {SingleLinks,DropDownLinks} from './PageLinks';
import ToggleDarkMode from './ToggleDarkMode';

const NavBar = () => {
    return (
        <div className="navbar">
            <div className="navbar-justify-left">
                <p className="navbar-brand">BDO<br/>Tracker</p>
            </div>
            <div className="navbar-justify-center">
                <ul className="navbar-list">
                    {SingleLinks.map((item)=> {
                        return (
                            <li className="navbar-item">
                                <a className={item.cName} href={item.url}>
                                    {item.title}
                                </a>
                            </li>
                        )
                    })}
                    <button className="dropdown-button" title="Life skills "> 
                    Life skills
                    </button>
                </ul>

            </div>
            <div className="navbar-justify-right">
                <ToggleDarkMode/>
            </div>
        </div>
        );
    }

export default NavBar
